import './App.css';
import Request from './Request';
import Header from './Header';
import {Routes, Route} from 'react-router-dom'

function App() {
  return (
    <Routes>

      <Route index element={
        <Request />
      } />
      <Route path={'/login'} element={
          <div>Login Page</div>
      } />
    </Routes>

  );
}

export default App;
